import List from '../List/List';

const data = [
    {
        class: "first",
        label: "first label",
        content: "first content"
    },
    {
        class: "second",
        label: "second label",
        content: "second content"
    },
    {
        class: "third",
        label: "third label",
        content: "third content"
    }

];

const CountryList: React.FC = () => {
    return <ul>
        <List class="first" label="first contact">Fist Contact</List>
    </ul>
};

export default CountryList;
